// App.js
import React from 'react';
import { BrowserRouter as Router, Route, Switch, NavLink } from 'react-router-dom';
import Home from './components/Home';
import Explore from './components/Explore';
import Notifications from './components/Notifications';
import Messages from './components/Messages';
import Profile from './components/Profile';

function App() {
  return (
    <Router>
      <div className="App">
        {/* Bottom menu */}
        <nav className="bottom-menu">
          <ul>
            <li><NavLink exact to="/" className="bottom-menu-item">Home</NavLink></li>
            <li><NavLink to="/explore" className="bottom-menu-item">Explore</NavLink></li>
            <li><NavLink to="/notifications" className="bottom-menu-item">Notifications</NavLink></li>
            <li><NavLink to="/messages" className="bottom-menu-item">Messages</NavLink></li>
            <li><NavLink to="/profile" className="bottom-menu-item">Profile</NavLink></li>
          </ul>
        </nav>

        {/* Main content */}
        <Switch>
          <Route exact path="/" component={Home} />
          <Route path="/explore" component={Explore} />
          <Route path="/notifications" component={Notifications} />
          <Route path="/messages" component={Messages} />
          <Route path="/profile" component={Profile} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
